import React, { Component } from "react";
import axios from "axios";
const stackexURl =
  "https://api.stackexchange.com/users?pagesize=10&site=stackoverflow";
class Stackex extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    };
  }
  componentDidMount() {
    axios
      .get(`${stackexURl}`)
      .then(res => this.setState({ data: res.data.items }));
  }

  render() {
    console.log(this.state.data);
    return (
      <div>
        <h2>{this.state.data.map(a => a.link)}</h2>mufasa
      </div>
    );
  }
}

export default Stackex;
